<h1><a name="_hmm_fatal_error_1093"></a>Fatal Error 1093</h1>
<p>
<span style=color:#FF0000>[This is preliminary documentation and subject to change.]</span> 
<dl>
<dt>
<b>&lt;1093. Fatal&gt;: "&lt;fileName&gt;&lt;line#&gt;: Only the type "INTEGER" can be enumerated according to the V1 SMI."</b></dt>
<dd>
Type assignment, SNMPv1-specific module semantic error. An SNMPv1 MIB enumeration can use only the type INTEGER.</dd>
</dl>
